import React, { useState, useEffect } from 'react';

function WorkSession({ tasks }) {
  const [selectedIds, setSelectedIds] = useState([]);
  const [sessionQueue, setSessionQueue] = useState([]);
  const [currentIndex, setCurrentIndex] = useState(0);
  const [seconds, setSeconds] = useState(0);
  const [isRunning, setIsRunning] = useState(false);
  const [breakBetweenTasks, setBreakBetweenTasks] = useState(5); // default 5 min

  // Toggle task selection
  const toggleSelect = (taskId) => {
    setSelectedIds((prev) =>
      prev.includes(taskId)
        ? prev.filter((id) => id !== taskId)
        : [...prev, taskId]
    );
  };

  // Build queue with breaks in between
  const buildSessionQueue = () => {
    const queue = [];
    const selectedTasks = tasks.filter((t) => selectedIds.includes(t.id));
    selectedTasks.forEach((task, idx) => {
      queue.push({ type: 'task', title: task.title, duration: Number(task.minutes) });
      if (idx !== selectedTasks.length - 1) {
        queue.push({ type: 'break', duration: breakBetweenTasks });
      }
    });
    return queue;
  };

  const startSession = () => {
    const queue = buildSessionQueue();
    if (queue.length === 0) return;

    setSessionQueue(queue);
    setCurrentIndex(0);
    setSeconds(queue[0].duration * 60);
    setIsRunning(true);
  };

  useEffect(() => {
    if (!isRunning) return;

    const interval = setInterval(() => {
      setSeconds((prev) => {
        if (prev <= 1) {
          clearInterval(interval);
          if (currentIndex + 1 < sessionQueue.length) {
            const next = sessionQueue[currentIndex + 1];
            setCurrentIndex((i) => i + 1);
            setSeconds(next.duration * 60);
          } else {
            setIsRunning(false);
            setCurrentIndex(0);
            setSessionQueue([]);
            setSeconds(0);
          }
          return 0;
        }
        return prev - 1;
      });
    }, 1000);

    return () => clearInterval(interval);
  }, [isRunning, seconds, currentIndex, sessionQueue]);

  const formatTime = (s) => {
    const mins = Math.floor(s / 60);
    const secs = s % 60;
    return `${mins}:${secs.toString().padStart(2, '0')}`;
  };

  const endSession = () => {
    setIsRunning(false);
    setSessionQueue([]);
    setCurrentIndex(0);
    setSelectedIds([]);
    setSeconds(0);
  };

  const currentItem = sessionQueue[currentIndex];

  return (
    <div style={{ marginTop: '40px', padding: '20px', border: '1px solid #ccc' }}>
      <h2>Work Session</h2>

      {!isRunning && (
        <>
          <ul style={{ textAlign: 'left' }}>
            {tasks.map((task) => (
              <li key={task.id}>
                <label>
                  <input
                    type="checkbox"
                    checked={selectedIds.includes(task.id)}
                    onChange={() => toggleSelect(task.id)}
                  />
                  {task.title} - {task.minutes} min
                </label>
              </li>
            ))}
          </ul>
          <div style={{ margin: '10px 0' }}>
            <label>
              Break between tasks (min):{' '}
              <input
                type="number"
                value={breakBetweenTasks}
                onChange={(e) => setBreakBetweenTasks(Number(e.target.value))}
                style={{ width: 50 }}
              />
            </label>
          </div>
          <button onClick={startSession} disabled={selectedIds.length === 0}>
            Start Work Session
          </button>
        </>
      )}

      {isRunning && currentItem && (
        <div>
          <h3>
            {currentItem.type === 'task'
              ? `Working on: ${currentItem.title}`
              : 'Break Time'}
          </h3>
          <h1>{formatTime(seconds)}</h1>
          <p>Step {currentIndex + 1} of {sessionQueue.length}</p>
          <button onClick={endSession}>End Session</button>
        </div>
      )}
    </div>
  );
}

export default WorkSession;
